import React from 'react';
import { Carousel, Button } from 'react-bootstrap';
import './Welcome.css';
import 'bootstrap/dist/css/bootstrap.css';
import Love from './WelcomeImg/love.jpg';
import Match from './WelcomeImg/couple.gif';
import Welcomeimg from './WelcomeImg/Welcome.jpg';
const Welcome = () => {

  return (
      
        <Carousel>
  <Carousel.Item>
    <img
      className="d-block w-100"
      src={Welcomeimg}
      alt="First slide"
      height="1300rem"
    />
    <Carousel.Caption>
      <h3>Welcome on Matcha</h3>
      <Button variant="Success" size="lg">Sign In</Button><p>OR</p><Button variant="Dark" size="lg">LogIn</Button>
    </Carousel.Caption>
  </Carousel.Item>
  <Carousel.Item>
    <img
      className="d-block w-100"
      src={Love}
      alt="Third slide"
      height="1300rem"
    />

    <Carousel.Caption>
      <h3>Second slide label</h3>
      <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
    </Carousel.Caption>
  </Carousel.Item>
  <Carousel.Item>
    <img
      className="d-block w-100"
      src={Match}
      alt="Third slide"
      height="1300rem"
    />

    <Carousel.Caption>
      <h3>Third slide label</h3>
      <p>Praesent commodo cursus magna, vel scelerisque nisl consectetur.</p>
    </Carousel.Caption>
  </Carousel.Item>
</Carousel>
  );
}

export default Welcome;
